import React from 'react';
import image1 from "../images/boats-2378150_1280.jpg";
import image2 from "../images/flower-field-250016_1280.jpg";
import image3 from "../images/forest-438432_1280.jpg";
import image4 from "../images/night-2458342_1280.jpg";
import image5 from "../images/rainbow-5372890_1280.jpg";
import image6 from "../images/sea-164989_1280.jpg";

const Projets = () => {
  return (
    <div className="projets-container">
      <img src={image1} alt="Projet 1" className="project-image" />
      <img src={image2} alt="Projet 2" className="project-image" />
      <img src={image3} alt="Projet 3" className="project-image" />
      <img src={image4} alt="Projet 4" className="project-image" />
      <img src={image5} alt="Projet 5" className="project-image" />
      <img src={img} alt="Projet 6" className="project-image" />
    </div>
  );
}

export default Projets;
